import "./App.css";
import Home from "./Components/home";
import About from "./Components/about";
import Contact from "./Components/contact";
import Projects from "./Components/projects";
import Layout from "./Components/layout";
import {React} from "react";
// import {BrowserRouter, Routes, Route} from "react-router-dom";
//import { Tabs, Tab } from 'react-bootstrap';
import {Nav, NavDropdown} from "react-bootstrap";


const App = () => {
   //const [key, setKey] = useState('home');
  return (
    <>
      <div>
      <h1>Test</h1>
      <Nav variant="pills" activeKey="1">
          <Nav.Item>
              <Nav.Link eventKey="home" href="#/home">
                  Home
              </Nav.Link>
          </Nav.Item>
          <Nav.Item>
              <Nav.Link eventKey="about" title="Item">
                  About
              </Nav.Link>
          </Nav.Item>
          <Nav.Item>
              <Nav.Link eventKey="contact" >
                  Contact
              </Nav.Link>
          </Nav.Item>
          <NavDropdown title="Pricing" id="nav-dropdown">
              <NavDropdown.Item eventKey="Basic Pricing">Basic</NavDropdown.Item>
              <NavDropdown.Item eventKey="Corporate Pricing">Corporates</NavDropdown.Item>
              <NavDropdown.Divider />

              <NavDropdown.Item eventKey="Enterprise pricing">Enterprise</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </div>
    </>

/*     <div>
      <h1>Test</h1>
      <Tabs
      id="controlled-tab-example"
      activeKey={key}
      onSelect={(k) => setKey(k)}
      className="mb-3"
    >
      <Tab eventKey="home" title="Home">
        <Home />
      </Tab>
      <Tab eventKey="about" title="About">
        <About />
      </Tab>
      <Tab eventKey="projects" title="Projects" >
        <Projects />
      </Tab>
      <Tab eventKey="contact" title="Contact">
        <Contact />
      </Tab>
    </Tabs> */

/*       <BrowserRouter>
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route index element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/projects" element={<Projects />} />
            <Route path="/contact" element={<Contact />} />

        </Routes>
      </BrowserRouter> */
    //</div>
  );
};

export default App;
